  \"2013-03-15T21:24:50.256640\",\n\t\"name\": \"specific-yield-high-plains-aquifer\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This raster data set represents specific-yield
  ranges in the High Plains aquifer of the United States. The High Plains aquifer
  underlies 112.6 million acres (176,000 square miles) in parts of eight States: Colorado,
  Kansas, Nebraska, New Mexico, Oklahoma, South Dakota, Texas, and Wyoming. Specific
  yield ranges from near zero to 30 percent (Gutentag and others, 1984). This data
  set was generated in ESRI ArcInfo Workstation Version 9.3, which is a geographic
  information system (GIS), from a contour map of specific-yield ranges. REFERENCES
  CITED -- Gutentag, E.D., Heimes, F.J., Krothe, N.C., Luckey, R.R., and Weeks, J.B.,
  1984, Geohydrology of the High Plains aquifer in parts of Colorado, Kansas, Nebraska,
  New Mexico, Oklahoma, South Dakota, Texas, and Wyoming: U.S. Geological Survey Professional
  Paper 1400-B, 63 p.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
